passage.text:
Manchester United did make an ambitious bid to sign Barcelona forward Neymar in the summer, according to the Brazil international's father. It has been widely reported that Louis van Gaal attempted to bring the 23-year-old to Old Trafford in the final weeks of the transfer window, with Neymar admitting that there had been discussions about a possible switch. Manchester United's desperate scramble for new striker after allowing Robin van Persie, Radamel Falcao and Javier Hernandez to all leave the club, led to them being linked with a host of players, including Bayern Munich forward Thomas Muller. United eventually parted with £36million for French teenager Anthony Martial from Monaco but, according to Neymar's father Neymar da Silva Santos, only after they had failed with a bid to lure his son away from the Nou Camp.
@highlight
Manchester United were widely reported to have bid for Neymar in summer
@highlight
The player's father has confirmed that the Old Trafford club did make offer
@highlight
The Brazil international is ready to open talks over a new deal at Barcelona

Apple Pay is launching in the UK for the first time today and will be available in a string of UK retail chains, banks and other services including Boots, Lidl, Marks & Spencer, the Post Office, Tesco, Transport for London and Waitrose. The technology means shoppers will be able to make payments using some of the latest Apple products, such as the iPhone 6. Several banks operating in the UK have signed up to the scheme. Customers with RBS, Nationwide, NatWest, Santander, Ulster Bank and MBNA can use the service from today. HSBC, which was expected to be one of the first banks to launch the service, said instead it would not launch it until the end of July. The bank's customers vented their frustration on Twitter. Tim Davies posted: 'So Apple Pay is out in the U.K. but none of my HSBC cards work.'
@highlight
iPhone 6 users will be able to make payments using their phone
@highlight
Customer with RBS, Nationwide, NatWest, Santander, Ulster Bank and MBNA can use Apple Pay from today

Washington (CNN) Three years after using the "nuclear option" to upend Senate tradition by effectively removing filibusters against most presidential nominations, Senate Democrats insisted Thursday they don't regret that decision, even as Donald Trump becomes president and they recognize they may be powerless to block controversial nominations. "I have absolutely no regret," said Oregon Democratic Sen. Jeff Merkley, who led the charge to weaken the filibuster, freeing up scores of President Barack Obama's executive and judicial branch nominees. "We'd never seen abuse of advice and consent in the history of our country so that was a necessary way to correct it."
@highlight
The "nuclear option" lowered the threshold to overcome a filibuster from 60 to 51 votes
@highlight
The decision to lower the threshold came after GOP obstruction on Capitol Hill

New York (CNN) -- The U.S. population is expected to top out at close to 312.8 million people just around the time crowds gather to watch the ball drop on New Year's Eve, according to new census data released Thursday. The figure represents a 0.7% increase from last year, adding 2,250,129 people to the U.S. population since the start of 2011, and a 1.3% increase since Census Day, April 1, 2010. The agency estimates that beginning in January, one American will be born every eight seconds and one will die every 12 seconds. U.S.-bound immigrants are also expected to add one person every 46 seconds.
@highlight
Census Bureau: U.S. population is expected to be 312.8 million on New Year's Day
@highlight
That figure represents a 0.7% increase from last year
@highlight
Lady Gaga, mayor to activate ball drop at Times Square on New Year's Eve
@highlight
NYC has supplanted Las Vegas as the top New Year's destination, Priceline poll says

(CNN) An American researcher has been sentenced to 10 years in prison after being convicted of spying, according to Iran. Princeton University identified the man as Chinese-born Xiyue Wang, an American citizen and graduate student in history. Wang was arrested in Iran last summer while doing scholarly research in connection with his Ph.D. dissertation, a university statement said. Earlier Sunday, the semi-official news agency Fars News, citing a video statement from Iranian judicial spokesman Gholamhossein Mohseni-Ejheie, initially identified the convicted man's nationality as Iranian-American. Later, Fars News, again citing Mohseni-Ejheie, said he was a citizen of the United States and a country other than Iran.
@highlight
Princeton identifies man as Chinese-born Xiyue Wang, an American citizen and graduate student in history
@highlight
He was arrested and put on trial for "gathering information," Iranian news service says

Mark McCall believes neutral territory offers Saracens hope of toppling mighty Clermont to reach a second successive European final. Marcelo Bosch landed a long-range penalty in the final act of Sunday's showdown with Racing Metro to clinch a 12-11 victory that has set up a last-four trip to St Etienne's Stade Geoffroy-Guichard on April 18. Awaiting in the Champions Cup semi-finals are Clermont, who are bristling with confidence after their remarkable 37-5 rout of runaway Aviva Premiership leaders Northampton. Marcelo Bosch launches a long range penalty towards the posts with the final act of Saracens' quarter-final The Argentinian centre is then mobbed by his team-mates after landing the match-winning kick
@highlight
Saracens through to Champions Cup semi-final after beating Racing Metro
@highlight
Marcelo Bosch landed last-gasp penalty to seal the win on Sunday
@highlight
Saracens face Clermont in semi-final in neutral St Etienne on April 18 or 19

(CNN) Scotland will likely seek independence for a second time this decade after the historic vote for the United Kingdom to leave the European Union, Scottish First Minister Nicola Sturgeon said Friday. Sturgeon's Scottish National Party was elected on a platform that vowed, in part, to revisit the independence issue -- last decided in a failed 2014 referendum -- should the country be "taken out of the EU against our will," Sturgeon said. "Scotland does now face that prospect," Sturgeon said. "It is a significant and material change in circumstances, and it is therefore a statement of the obvious that the option of a second referendum must be on the table, and it is on the table."
@highlight
Scottish First Minister Nicola Sturgeon's party has vowed to revisit independence issue
@highlight
Independence rejected in 2014, but with UK vote on EU, things have changed, she says

Speaking prior to England's away friendly fixture against Republic of Ireland, ITV pundits Ian Wright and Paul Scholes disagreed on the issue of Jack Wilshere's position. Whereas Wright suggested that a quintessential holding role would 'be the best place for him in the future,' Scholes suggested that due to his creativity, he needs a player sitting behind him in the middle of the park. Former Arsenal striker, Wright, added that 23-year-old Wilshere no longer has the pace he once did as a teenager and will therefore continue to 'get into trouble' making marauding runs forward. Wilshere's best position has long been the subject of debate due to his fondness of roaming forward, while possessing a combative element to his game.
@highlight
Ian Wright and Paul Scholes differed over Jack Wilshere's best position
@highlight
Wright thinks he has lost pace and will therefore continue to 'get into trouble'
@highlight
Scholes disagrees believing he still has the ability to beat players and could do with a player like Michael Carrick sitting behind him
@highlight
Wilshere was praised by Scholes and Lee Dixon after England's 0-0 friendly draw at the Aviva Stadium in Dublin

George Boyd scored a famous Burnley winner as Manchester City's strongarm tactics backfired ahead of their big date in The Nou Camp. Turf Moor was bouncing as Boyd lashed home a poor clearance from returning City captain Vincent Kompany after 61 minutes. And Manuel Pellegrini's men – who sent on £50million substitutes Wilfried Bony and Stevan Jovetic to try and salvage the game – were lucky to survive with 11 men after bad challenges from Sergio Aguero and Martin Demichelis. CLICK HERE to read Sportsmail's Joe Bernstein's full match report from Turf Moor. Host commentator What a potential season-defining moment Burnley's win could be tonight. The victory still sees the Clarets in the relegation zone - but by only one point with Sunderland looking over their shoulders ever-more. Meanwhile the defeat for City is damaging for their title hopes. A win for Chelsea on Sunday would see Manuel Pellegrini's side trail by eight points with nine games remaining. City now have to pick themselves up with a daunting trip to Barcelona in the Champions League on Wednesday night.
@highlight
George Boyd puts Burnley ahead with a brilliant low volley on 61 minutes
@highlight
Manchester City were denied a penalty appeal in injury time after Pablo Zabaleta fell under the challenge of Ben Mee
@highlight
Burnley XI: Heaton, Trippier, Shackell, Duff, Mee; Barnes, Arfield, Jones, Boyd; Ings, Vokes
@highlight
Manchester City XI: Hart, Zabaleta, Kompany, Demichelis, Clichy, Navas, Fernandinho, Yaya Toure, Silva, Dzeko, Aguero

Inevitably, it all kicked off in the end. Three games in two competitions over 10 days has forged some barely disguised contempt between Celtic and Dundee United. Six red cards tell their own tale. For Jackie McNamara’s team, the frustration — and indiscipline — is growing. Ryan McGowan became the fourth United player to see red in the dying minutes, seconds after Celtic’s Anthony Stokes was dismissed for a retaliatory kick at Paul Paton. Afterwards, Ronny Deila rounded on the Australian, claiming he could have injured substitute Liam Henderson ‘for life’. The open wounds enveloping this fixture are now there for all to see.
@highlight
Celtic comfortably progressed to the William Hill Scottish Cup semi-finals
@highlight
Jason Denayer, Leigh Griffiths, Kris Commons and Virgil van Dijk all scored for the hosts at Celtic Park
@highlight
Both sides ended with 10 men as Anthony Stokes and Ryan McGowan were sent off

(CNN) On the hot summer night on of July 12, 1967, two white policemen in Newark, New Jersey, arrested an African-American cabdriver named John Smith for "tailgating" and driving in the wrong direction. The police also accused Smith of physical assault and using offensive language. Race relations had been growing more tense over the year as Newark Mayor Hugh Addonizio announced a series of decisions that had angered the African-American community. Some of the residents who were living across the street from where the arrest took place walked out of their homes to watch the incident. Smith was badly beaten. As the police hauled him to the Fourth Precinct station, word spread within the community about what was happening. African-American taxi drivers sent out reports through their radios. A crowd slowly gathered to monitor and protest Smith's treatment. Word quickly spread about the arrest and what was taking place inside the station.
@highlight
Julian Zelizer: On July 12, 1967, riots erupted in Newark, New Jersey, after an African-American man was pulled over and beaten by two white policemen
@highlight
The fiftieth anniversary of the riots is a reminder that we still face some of the same issues of racism in policing and criminal justice, writes Zelizer

Hong Kong (CNN) A cybersecurity firm in the United States believes state-sponsored Chinese hackers were trying to infiltrate an organization with connections to a US-built missile system in South Korea that Beijing firmly opposes. "China uses cyber espionage pretty regularly when Chinese interests are at stake to better understand facts on the ground," John Hultquist, the director of cyber espionage analysis at FireEye, told CNN's News Stream. "We have evidence that they targeted at least one party that has been associated with the missile placements." A spokesperson with South Korea's Ministry of Foreign Affairs told CNN there was an attempted cyber attack last month on their systems originating from China, but would not comment when asked if THAAD was targeted.
@highlight
The firm says the hackers were likely gathering intelligence, not trying to disrupt a system
@highlight
South Korea confirmed Chinese hackers attempted to infiltrate their systems
@highlight
China is strongly opposed to THAAD's deployment

Washington (CNN) Americans views of Obamacare tilt narrowly positive, according to a new CNN/ORC poll, marking the first time more have favored than opposed the law since its passage in 2010. The shift comes at the same time more than 8-in-10 say the law is likely to be repealed and replaced by incoming president Donald Trump. Overall, 49% say they favor the 2010 health care law, more formally known as the Patient Protection and Affordable Care Act, while 47% oppose it. Though a mostly mixed review overall, that's a sharp improvement compared with previous polling on the law. More have opposed than favored the law in every CNN/ORC poll on this question from March 2010 until now. The shift in the law's favor stems largely from Democrats and independents, while views among Republicans haven't moved much.
@highlight
49% say they favor the 2010 health care law
@highlight
But few feel the ACA has done much to help them personally

(CNN)  -- The promoter for Filipino world champion boxer Manny Pacquaio, Bob Arum, has confirmed the "super fight" with American Floyd Mayweather Jr. will not happen after mediation talks between the two parties failed. "The fight is off, Floyd Mayweather walked away," Arum told the USA Today newspaper in a telephone interview on Wednesday. Pacquiao and Mayweather had asked retired federal judge Daniel Weinstein to help the two parties resolve a dispute, which had threatened to derail what was expected to be the most lucrative bout in the history of the sport. However, after two days of further negotiation, Arum said no agreement could be made with Mayweather, with the result that both fighters would now miss out on a potential purse of $40 million each.
@highlight
Top Rank promoter Bob Arum, confirms the "super fight" with American Floyd Mayweather Jr. is off
@highlight
The two camps failed to resolve a bitter dispute over the issue of drug-testing before their match-up
@highlight
Retired judge Daniel Weinstein failed to secure agreement for what could have been the most lucrative fight in history
@highlight
Pacquiao will now fight undefeated Israeli WBA super welterweight champion Yuri Foreman

Less than a month after sharing her inspiring story, Madeline Stuart has been contacted by more than seven fashion brands as well as multiple make-up and accessory companies who want her to model their products. But the 18-year-old Brisbane teenager, who has Down Syndrome, has not forgotten her real pursuit – to change the stigma around disability - according to her mother Rosanne, who insists that Maddy's life has barely changed since she made international headlines. 'We've had a lot off offers and Maddy is loving it, but it hasn't fazed us much - I've just lost a bit of sleep trying to deal with everything,' Rosanne told Daily Mail Australia.
@highlight
18-year-old Madeline Stuart, from Brisbane, has Down syndrome
@highlight
Last year she decided to focus on her health and fitness and lost 20 kilos
@highlight
She has been inundated with modeling offers from seven fashion brands
@highlight
Multiple make-up and accessory companies have also contacted the teen
@highlight
She launched her own website and gained over 364K Facebook followers
@highlight
Maddy and her mum are on a mission to change the way people see beauty
@highlight
Her mother said she had no support and little hope when Maddy was born

Australia's property boom has been very generous to some of the country's richest and most famous - with the top 10 'celebrity sales' of the past year netting a combined $120 million. The list includes some of Australia's biggest names - led by casino mogul James Packer's $70 million divorce settlement sale of the six-bedroom 'La Mer' mansion in Sydney's eastern suburbs. Socceroos superstar Tim Cahill also made the winners list with his waterside escape in the city's south bringing in $6.5 million while Hugh Jackman's more modest Melbourne apartment was offloaded for $740,000. James Packer and ex-wife Erica topped the impressive line-up compiled by Domain.com.au for Daily Mail Australia and other notable members of the millionaire's club included Cate Blanchett at $20 million and reality TV favourites Michelle Bridges and Jamie Durie.
@highlight
Property boom delivers a combined $120 million windfall for Australia's rich and famous
@highlight
Casino mogul James Packer led the list with a $70 million sale ahead of actors, reality TV stars and sporting heroes
@highlight
Packer's marital home 'La Mer' with then-wife Erica was sold as part of their divorce settlement
@highlight
Cate Blanchett's Hunters Hill mansion topped the $20 million mark
@highlight
Sporting superstars Tim Cahill and Lance 'Buddy' Franklin also made millions from their sales
@highlight
At the lower end of the market Hugh Jackman and Deborah-Lee Furness offloaded a Melbourne apartment

People have gathered across Australia in a number of vigils to mourn those killed in terrorist attacks in Paris last weekend. Frenchwoman Elisabeth Franco was one of thousands who packed services in Melbourne on Monday night to remember the victims of the attacks. 'Because we are so far away, we can't take our relatives into our arms,' she told AAP. Ms Franco, 32, a lone figure among families in Melbourne's Federation Square, said she needed to be with other French people on this day of mourning. Hundreds also gathered Brisbane Town Hall, while a mass was held at St Mary's Catholic Cathedral in Sydney, which was also attended by Jewish and Muslim leaders.
@highlight
Thousands of people have gathered around Australia at vigils held in Melbourne, Sydney and Brisbane on Monday
@highlight
Mourners carried flags and signs to pay tribute to and remember those people killed in the terror attacks in Paris
@highlight
It comes after additional services were held over the weekend, in the immediate aftermath of the Paris attacks
@highlight
The Sydney Opera House was lit up in the blue, white and red of the French flag - along with other landmarks
@highlight
See more of the latest breaking news and updates on the Paris terror attacks

Arsenal players are choosing to employ relatives as their agents after FIFA washed their hands of attempts to regulate middle-men. Alex Oxlade-Chamberlain’s father Mark, the former England international, is acting as his representative since Alex split from Impact Sports Management, although Raheem Sterling’s adviser Aidy Ward is also involved. Calum Chambers is on the books of Cassius Sports Management, whose head of talent ID is his stepfather Steve Moss. Alex Oxlade-Chamberlain is represented by his father, former England international Mark Calum Chambers  is on the books at Cassius Sports Management; his stepfather works for the company too Danny Welbeck is looked after by his brothers Chris and Wayne
@highlight
Arsenal players are choosing to employ their relatives as agents
@highlight
FIFA have washed their hands of attempts to regulate middle-men
@highlight
Alex Oxlade-Chamberlain, Calum Chambers, Jack Wilshere, Kieran Gibbs and Danny Welbeck are among those to use the policy
@highlight
Liverpool club secretary Stuart Hayton is leaving Anfield after  two seasons

The Copa America, which begins in Chile on Thursday night, is a showcase of the best South American talent, from Lionel Messi to Neymar to James Rodriguez. But what about those up-and-coming players hoping to make a name for themselves during the tournament? We take a look at 10 promising young stars to watch. It was what you might call a baptism of fire... AC Milan prodigy Gamarra, 18, was handed his international debut for Bolivia in their 5-0 thrashing at the hands of Argentina last weekend. Hopefully things will get better for the teenager, who joined Milan's academy last year and is described as the 'Bolivian Pirlo' because of his well-developed passing skills in central midfield.
@highlight
Copa America kicks-off in Chile on Thursday night
@highlight
Tournament is perfect chance for rising stars to boost their profile
@highlight
Man United's Angelo Henriquez will hope to impress for host nation
@highlight
Geferson, 21, is late call-up to Brazil squad after injury to Marcelo
@highlight
Sebastian Gamarra of Milan is described as the 'Bolivian Pirlo'
@highlight
CLICK HERE to read our ultimate preview of the Copa America

Washington (CNN) -- A 19-year-old Virginia teenager who says he was kidnapped and tortured by Kuwaiti authorities and placed on a "no-fly" list that prevented him from going home has returned to the United States and been reunited with his family. FBI agents questioned Gulet Mohamed after his plane landed at Dulles International Airport in suburban Washington early Friday, said his attorney, Gadeir Abbas. That questioning ended, and the teen was subsequently cleared through customs. Mohamed's family greeted him with balloons and a dozen roses. Mohamed's lawyers argued that as a U.S. citizen, Mohamed had a right to be in the United States, and that the government had provided no reason for including him on the no-fly list. Federal prosecutors later told a judge they were making arrangements to allow the teenager to return to the United States.
@highlight
NEW: Gulet Mohamed is questioned by FBI, met by family at Dulles International Airport
@highlight
Mohamed, 19, is suing the U.S. government over the alleged detention.
@highlight
Mohamed had been trapped in Kuwait for nearly a month
@highlight
Mohamed went to the Mideast to visit relatives and to learn Arabic, according to the lawsuit

Police were led to the site where Stephanie Scott's remains were found by the family of her accused killer, it has been revealed. Detectives were pointed to Cocoparra National Park north of Griffith, NSW by the mother and brother of Vincent Standford - who has been charged with Ms Scott's murder. Standford, 24, was familiar to the area and had camped and travelled through the park on many occasions, News Corp reported. Police discovered the burnt remains of a woman's body - who they believe is Ms Scott, 26, - in bushland late around 5pm on Friday afternoon, the night before the Leeton school teacher was due to get married.
@highlight
Police discovered the body of a female at a national park on Friday
@highlight
It is believed to be the remains of teacher Stephanie Scott, 26
@highlight
The body had been burnt and a gasoline can was found nearby
@highlight
Vincent Stanford, a cleaner at her school, has been charged with murder
@highlight
Stanford's family led police to Cocoparra National Park north of Griffith
@highlight
Forensic testing will be carried out on the remains of the body
@highlight
Ms Scott was due to marry her partner Aaron Leeson-Woolley on Saturday

(CNN) An empowered special counsel. A White House consumed by scandal and on its heels. You don't have to make too big a leap to get from Donald Trump's White House of today to Bill Clinton's White House of the 1990s. But there's a long way to go before we can start making real comparisons between Robert Mueller and Ken Starr or Trump and Clinton. That doesn't mean a very few Democrats aren't trying. Reps. Brad Sherman of California and Al Green of Texas introduced an Article of Impeachment against Trump Wednesday, arguing that Trump's alleged attempts to influence former FBI Director James Comey and Comey's subsequent firing equal high crimes and misdemeanors, one of the bars for impeachment.
@highlight
A long way to go before comparing Mueller and Starr or Trump and Clinton
@highlight
Only two Democrats are officially using the word at this point

The likes of Jack Wilshere, Alex Oxlade-Chamberlain and Per Mertesacker got back down to action on Tuesday afternoon as Arsenal boss Arsene Wenger put his players through their paces at London Colney. A large majority of Arsenal's first team stars returned to training as they geared up for their side's tour of Singapore. The Gunners will take on a Singapore Select XI at the Singapore National Stadium on July 15 before facing either Everton or Stoke City  on July 18 as they look to win the Asia Trophy. The Brazilian winger has had to spend the last four years on loan in Spain with Levante, Alcoyano, Ponferradina, Murcia and Almeria in order to be issued with a Spanish passport, which allows the 22-year-old to play in the Barclays Premier League.
@highlight
Arsenal's stars returned to London Colney as Arsene Wenger put his players through their paces
@highlight
Gunners teenager Dan Crowley training alongside senior stars such as Jack Wilshere and Per Mertesacker
@highlight
Wellington Silva, who has spent the last four years out on loan, took part in the training session
@highlight
Arsenal will tour Singapore before returning to England in order to host the Emirates Cup
@highlight
Gunners face Chelsea at Wembley in the Community Shield on August 2 before facing West Ham in league opener

Washington (CNN) Donald Trump holds a broad 16-point lead among those likely to vote in South Carolina's Republican primary this Saturday, according to a new CNN/ORC Poll. Meanwhile, Hillary Clinton tops Bernie Sanders by 18 points in the state's Democratic primary, which will be held a week later. In the Republican race, Trump, at 38%, tops Texas Sen. Ted Cruz, who holds second place with 22%. Behind those two, Florida Sen. Marco Rubio garners 14% support, former Florida Gov. Jeb Bush is at 10%, retired neurosurgeon Ben Carson has 6% and Ohio Gov. John Kasich is at 4%. Trump's lead is bolstered by widespread perceptions of him as the candidate best able to handle the economy, immigration and ISIS, and further, that he has the best chance to win in November and would be most likely to change the way things work in Washington.
@highlight
In the Republican race, Trump, at 38%, tops Texas Sen. Ted Cruz, who holds second place with 22%
@highlight
Likely voters in the Democratic primary tilt sharply toward Clinton over Sanders, 56% for Clinton to 38% for Sanders

(CNN) I was sitting at home Friday when, in the background, I heard the ugly phrase leap out from the TV. Democratic presidential front-runner Hillary Clinton was being interviewed on CNN's "The Lead" with Jake Tapper when she used a blistering term rooted in racism against Native Americans to describe Donald Trump, the leading Republican presidential candidate. "I have a lot of experience dealing with men who sometimes get off the reservation in the way they behave and how they speak," Clinton told Tapper. Within hours, Clinton's political director, Amanda Renteria, took to Twitter saying Clinton "meant no disrespect to Native Americans."
@highlight
Simon Moya-Smith: Clinton's use "off the reservation," shows Americans' casual racism to Native Americans
@highlight
He says Trump doesn't help when he says "Indians have gone wild' over her usage

The Clintons are going back to the White House this spring – onstage, that is. 'Clinton the Musical,' the brainchild of two Australian brothers, makes its off-Broadway debut in April with a hysterical premise and a gentle look back at the '90s. The play celebrates the first baby-boomer president – the one who preferred briefs to boxers, played a sax on national TV, presided over an economic boom and got himself impeached. The cast of characters includes Dick Morris, Newt Gingrich, Monica Lewinsky and former Clinton special prosecutor Kenneth Starr, who sings 'A Starr Is Born' and 'Sexual Relations.' 'Clinton the Musical' stars Tom Galantich (left) as the wholesome and intelligent Bill Clinton, Duke Lafoon (right) as the sex-crazed 'Billy Clinton,' and  Kerry Butler (center) as Hillary Rodham Clinton – the only person who can see both of them
@highlight
Two men will play the 42nd president: one portraying him as wholesome and intelligent, and another as a lascivious rogue
@highlight
Only Hillary Rodham Clinton can see both
@highlight
Cast includes actors playing Clinton adviser Dick Morris, Monica Lewinsky, Newt Gingrich and Independent Counsel Kenneth Starr – who argued for the president's impeachment
@highlight
Starr sings songs titled 'A Starr Is Born' and 'Sexual Relations'
@highlight
Show opens April 9, and features a dancing press corps

Police in Oakland, California, say they have found no evidence to link murder suspect Robert Durst to the 1997 disappearance of Charlotte teenager Kristen Modafferi. Durst, the subject of HBO's documentary series The Jinx, was arrested last weekend and was charged on Monday by L.A. officials in connection with the 2000 murder of his friend Susan Berman. In the wake of Durst's arrest, Oakland police revealed that they and the FBI were looking into the possiblility that he was somehow involved in Modafferi's disappearance. Scroll down for video Police in Oakland, California, say they have found no evidence to link murder suspect Robert Durst to the 1997 disappearance of Charlotte teenager Kristen Modafferi
@highlight
Police in California say they have found no evidence to link murder suspect Robert Durst to the 1997 disappearance of  Kristen Modafferi
@highlight
Durst was rumored to be living in the area at the time of Modafferi's disappearance
@highlight
Police in Eureka, California, do however remain interested in Durst in connection with the disappearance of Karen Mitchell the same year
@highlight
Durst was arrested last weekend and was charged on Monday in connection with the 2000 murder of his friend Susan Berman

Los Angeles (CNN) Macy Gray is known for her edgy, enigmatic voice and her soulful music about love and life, but in her 10th studio release, which will be out this summer, the Grammy-winning singer is getting political in a way she hasn't before. "For me, being a black female, that puts me right in the thick of all the racism that's going on and all the misogyny," the R&B singer told CNN. Fans got a taste of what's to come when Gray released "White Man" in February -- an anthem about racism in America. The video features a tense yet harmonious dance between a black woman and a white woman that represents both the deep divisions and the unity that characterize race relations in America.
@highlight
Macy Gray's latest single "White Man" tackles racism in America
@highlight
"(Trump's) an old, white dude from New York ... he says what he thinks," Gray said

MSNBC has cut back its coverage of the 10th anniversary of Hurricane Katrina to avert awkward references to outlandish claims Brian Williams made about his time in New Orleans, it is reported. Williams, 56, asserted in a 2006 interview that he had seen a 'face-down' dead body float past his hotel window in the Louisiana city's French Quarter in the aftermath of Katrina in September 2005. His claims were rubbished earlier this year by Myra DeGersdorff, manager of the Ritz-Carlton, who said the area saw only 'inches' of flooding and Williams must have 'misremembered' the incident. Now, MSNBC - which is taking on the journalist as a breaking news anchor from NBC Nightly News - has deliberately chosen to scale back its reporting on the Katrina anniversary, Page Six reports.
@highlight
Brian Williams, 56, claimed in 2006 interview that he had seen dead body float past his hotel in New Orleans, Louisiana, in the aftermath of Katrina
@highlight
Hotel manager rubbish his assertion, saying the news anchor must have 'misremembered' incident because area saw only 'inches' of floodwater
@highlight
Williams also accused of lying about his hotel being'overrun with gangs'
@highlight
Now, MSNBC - which is taking on journalist as a breaking news anchor  - has chosen to scale back coverage of Katrina anniversary, it is reported
@highlight
It has apparently decided not to send any main anchors to New Orleans - and has even pushed back start date of Williams's job to mid-September
@highlight
Decisions 'made in bid to avert awkward references to Williams scandal'
@highlight
Comes as President Barack Obama has marked Katrina anniversary by meeting residents who continue to rebuild  lives  following 2005 hurricane

An unusual nexus of mining interests, relief work in Haiti, and a former U.S. first family is raising new ethics questions that could affect Hillary Clinton's presidential ambitions. Clinton's brother, Tony Rodham, was a board member of a North Carolina mining company that enjoyed prime access to Haitian gold deposits in the wake of post-earthquake relief work organized in part by former president Bill Clinton through the Clinton Foundation. Another board member of the firm, VCS Mining, was former Haitian Prime Minister Jean-Max Bellerive, who co-chaired the charitable Interim Haiti Recovery Commission with Mr. Clinton. The revelation, smacking of cronyism and back-room government dealing, is part of a forthcoming book by Government Accountability Institute founder Peter Schweizer, whose work exposing the investment 'insider trading' habits of members of Congress caused national outrage in 2011 even though the practice was legal.
@highlight
Book due out in May describes alleged sweetheart deal that netted VCS Mining a gold concession that hadn't been issued to anyone in 50 years
@highlight
Tony Rodham, Mrs. Clinton's brother, sat on the company's board
@highlight
Another board member co-chaired a relief effort with former President Bill Clinton following a devastating 2010 earthquake
@highlight
'Clinton Cash' is the latest from Peter Schweizer, who turned heads in 2011 with an expose about insider trading by members of Congress

President Barack Obama will call on the global community to open its arms to wayfaring migrants when he visits with persecuted Muslim refugees and other poor youth at a foundation tomorrow in Malaysia. His visit to the Dignity for Children Foundation will likely be overshadowed by his administration's troubles back home with its own migrant policy, however, and a Congress that's eager to put new limitations on which refugees the U.S. will take. Top-polling Republican presidential candidates have used the ISIS-instigated Paris terrorist attack a week ago to lobby for bans on all Syrian refugees, and at least one has lobbied for a religious test that would keep out members of the Muslim population.
@highlight
A senior Obama adviser pointedly said the president will use the occasion to push his message that the refugee crisis is 'a global challenge'
@highlight
His visit to the Dignity for Children Foundation will likely be overshadowed by his administration's troubles back home with its own migrant policy
@highlight
Congress is eager to put new limitations on which refugees the U.S. will take; House passed legislation requiring additional screening certifications
