BEIJING, China (CNN) -- Fireworks, athletes and pageantry on a scale never before seen in the Olympics opened the Summer Games in Beijing on Friday as the Asian nation kicked off the biggest and most scrutinized Games in history. Fans celebrate the Opening Ceremony of the 2008 Olympic Games in Beijing, China, on Friday. Chinese President Hu Jintao declared the Olympics officially open, retired Chinese gymnastics champion Li Ning was carried through the air to light the Olympic cauldron, and pyrotechnics exploded throughout Beijing as the crowd of 91,000 at National Stadium cheered wildly. It was a stunning display from the nation of 1.3 billion people. Some media observers believe that the Opening Ceremony may be the most-watched television event in history.
