Flip Saunders, who rose from the backwaters of basketball's minor leagues to become one of the most powerful men in the NBA as coach, team president and part owner of the Minnesota Timberwolves, died Sunday, the team said. He was 60. Saunders was diagnosed with Hodgkin's lymphoma in June and doctors called it 'treatable and curable.' But he took a leave of absence from the team in September after complications arose during his treatment, which included chemotherapy. He had been hospitalized for more than a month. 'Flip was a symbol of strength, compassion, and dignity for our organization,' owner Glen Taylor said in a statement. 'He was a shining example of what a true leader should be, defined by his integrity and kindness to all he encountered.'
