(CNN) A former attorney for two of Prince's dead siblings says they revealed Prince had an addiction to Percocet decades before his sudden death in April. Prince's half-brother, Duane Nelson, said he used to get the drug for Prince to help him come down after shows, Michael B. Padden said. "Duane told me that he witnessed him taking the drugs and he also procured Percocet for him," Padden said. Nelson was adamant that Prince was in no way just a recreational user, Padden said. He started using the drug to help him deal with the rigors of performing. Another half-sibling, Lorna Nelson, confirmed Prince's drug use but was not involved in getting drugs for him, Padden said. She died in 2006.
