Wisconsin's Republican governor Scott Walker became the 20th major party candidate for president on Monday with a speech that name-checked Planned Parenthood, the ISIS terror army, Hillary Clinton, Vladimir Putin and the Kohl's chain of department stores. The early GOP favorite has waited month after month to enter the race as others leaped in, but finally declared his availability for the White House in a suburb of Milwaukee. Walker cast himself as the economic and military heir to Ronald Reagan, and a hardscrabble survivor with a statewide record that, he says, can scale up to the size of a nation.
