(CNN) On the hot summer night on of July 12, 1967, two white policemen in Newark, New Jersey, arrested an African-American cabdriver named John Smith for "tailgating" and driving in the wrong direction. The police also accused Smith of physical assault and using offensive language. Race relations had been growing more tense over the year as Newark Mayor Hugh Addonizio announced a series of decisions that had angered the African-American community. Some of the residents who were living across the street from where the arrest took place walked out of their homes to watch the incident. Smith was badly beaten. As the police hauled him to the Fourth Precinct station, word spread within the community about what was happening. African-American taxi drivers sent out reports through their radios. A crowd slowly gathered to monitor and protest Smith's treatment. Word quickly spread about the arrest and what was taking place inside the station.
@highlight
