(CNN) In the next few days, President Trump's order to send 59 Tomahawk cruise missiles to attack Syria's Shayrat airfield will be both praised and criticized. The order might also be called illegal. In fairness, a President's authority to fire some cruise missiles into another country without checking with Congress has become a hazy area of Constitutional law in modern times. It's true that under Article I, Section 8, Congress has the power to declare war, tax and spend for defense, and provide for our armed forces. On the executive side, however, the Constitution simultaneously names the President as the "Commander in Chief of the Army and Navy of the United States," who must, to the best of his ability "preserve, protect and defend the Constitution of the United States."
@highlight
Danny Cevallos: Some Democrat lawmakers are criticizing Trump's Syria missile strike for not following the protocol outlined in the Constitution
@highlight
During the Clinton and Obama administrations, Congress and the courts set a new precedent for how they are likely to react to his orders, Cevallos says

A former SS sergeant described how so many Jews were brought to the Auschwitz death camp at once that he was put on a 24-hour shift guarding the ramp where they disembarked from the trains. He told in chilling detail how cattle cars full of Jews were brought to the Auschwitz death camp, the people stripped of their belongings and then most led directly into gas chambers. Oskar Groening is being tried on 300,000 counts of accessory to murder, related to a period between May and July 1944 when around 425,000 Jews from Hungary were brought to the Auschwitz-Birkenau complex in Nazi-occupied Poland and most immediately gassed to death.
