(CNN) In 2016, Americans were infected with more than 2 million new cases of gonorrhea, syphilis and chlamydia, the highest number of these sexually transmitted diseases ever reported, the Centers for Disease Control and Prevention said Tuesday. "Clearly we need to reverse this disturbing trend," said Dr. Gail Bolan, director of CDC's Division of STD Prevention. "The CDC cannot do this alone and we need every community in America to be aware that this risk is out there and help educate their citizens on how to avoid it." The agency's annual Sexually Transmitted Disease Surveillance Report shows that more than 1.6 million of the new cases were from chlamydia, 470,000 were from gonorrhea and nearly 28,000 cases were primary and secondary syphilis, the most infectious stages of the disease, according to the CDC. While all of these can be cured by antibiotics, many people go undiagnosed and untreated.
