(CNN) In the next few days, President Trump's order to send 59 Tomahawk cruise missiles to attack Syria's Shayrat airfield will be both praised and criticized. The order might also be called illegal. In fairness, a President's authority to fire some cruise missiles into another country without checking with Congress has become a hazy area of Constitutional law in modern times. It's true that under Article I, Section 8, Congress has the power to declare war, tax and spend for defense, and provide for our armed forces. On the executive side, however, the Constitution simultaneously names the President as the "Commander in Chief of the Army and Navy of the United States," who must, to the best of his ability "preserve, protect and defend the Constitution of the United States."
@highlight
