(CNN) Writing in the New York Times, former President Jimmy Carter this week called on President Barack Obama to join with 137 countries and recognize the State of Palestine. Arguing that the two-state solution is dying and that something must be done to keep hope alive, Carter wrote: "I fear for the spirit of Camp David. We must not squander this chance." Yet having spent the better part of my adult professional life working to promote, facilitate and consummate negotiations between Arabs and Israelis, my advice is precisely the opposite of Mr. Carter's. I completely understand the urgent desire on the part of American peacemakers to do something. And in the case of Mr. Carter, that passion is especially strong. Few Israelis and Egyptians I know would take issue with the fact that had it not been for the role played by the US, led by President Jimmy Carter -- building on Anwar Sadat's historic visit and Menachem Begin's strong response -- there would have been no Egyptian-Israeli peace treaty in 1979.
