Kabul, Afghanistan (CNN)  -- The man believed to be the suicide bomber who killed seven CIA employees and contractors last year appears in a newly released video, claiming to have tricked Jordanian intelligence officers as a double agent. The 43-minute video, posted on various Islamic radical Web sites Saturday, shows Humam Khalil Abu-Mulal al-Balawi, whom a former U.S. intelligence official identified as the suicide bomber. Family members have said that the man in the video, who uses the alias Abu Dajana Al-Khorasani, is al-Balawi. A much shorter version of the video was posted online in January. The December 30 bombing at a U.S. base in Khost, in southeastern Afghanistan, killed seven CIA operatives and a Jordanian army captain. The video posted Saturday is dated "Safar 1431" on the lunar calendar, which includes any day between January 16, 2010 and February 13, 2010.
