Washington (CNN) New Jersey Gov. Chris Christie's February endorsement of Donald Trump shocked observers as the first sign of capitulation from the Republican establishment to the man who would eventually become their nominee -- and then their president. It could've easily been the other way around. That's one revelation in "Unprecedented: The Election that Changed Everything," CNN's upcoming book on the 2016 race that comes out December 6. "Trump told Christie in 2015 that he didn't expect to make it past October—at which point he would endorse Christie, according to a Christie adviser who asked not to be named in order to speak about behind-the-scenes maneuvers," according to the book, written by CNN's Thomas Lake with reporting from Jodi Enda, Susan Baer and CNN's political team.
