(CNN) -- One of the most valuable routes in the airline industry is the one that joins New York to London. It is the world's busiest route, one particularly frequented by business travelers, and currently, it is dominated by United Airlines. All that is set to change, thanks to a pivotal partnership between Delta Airlines and Virgin Atlantic. Last month, the two airlines unveiled a codeshare agreement across 108 routes, with Delta acquiring a 49% share of the British carrier. For Delta, the deal provides access to a market that, though lucrative, has been difficult for them to crack. "Heathrow is the most important destination for the U.S. business traveler, and we've not been able to provide the global frequency that our customers need," admits Edward Bastian, Delta's president. "Virgin was the best way to get to them."
