(CNN)Serbian forces committed egregious violent acts against ethnic Croatians in the early 1990s, but they don't equate to genocide, a U.N. court ruled Tuesday. The 153-page ruling from the International Court of Justice means that modern-day Serbia will not have to pay restitution to Croatia, which in 1991 split from what was then Yugoslavia. The decision relates only to the two national governments' responsibility to one another, not the culpability of any individuals for targeting members of an ethnic group. Such individual cases are handled by the International Criminal Tribunal for the former Yugoslavia (ICTY), another U.N. court. "Croatia has not established that the only reasonable inference that can be drawn from the (Serbians') pattern of conduct ... was the intent to destroy, in whole or in part, the Croat group," the International Court of Justice (or ICJ) ruled. "... It follows ... Croatia has failed to substantiate its allegation that genocide was committed."
@highlight
