(CNN) --  A state-run Chinese newspaper expressed relief Monday that senior Japanese officials had dismissed the country's air force chief after he denied Japan's aggression before and during World War II. General Toshio Tamogami Gen. Toshio Tamogami lost his job as chief of staff for Japan's Air Self-Defense Force, the Ministry of Defense said, after saying in an essay that "it is certainly a false accusation to say that our country was an aggressor nation." Japanese troops invaded China in 1937 and were widely accused of gross human rights abuses, including raping tens of thousands of girls and women and killing several hundred thousand others in what has come to be called "The Rape of Nanking." Imperial Japan also invaded several other Asian nations, leading to the death and misery for an untold number.
